import { Fragment } from "react";
import styled from "styled-components";
import { useForm } from "react-hook-form";

export const SignupPage = () => {
  return (
    <SignupContainer>
      <div>회원가입 페이지</div>
      <div className="inputDiv">
        <span>
          <input
            type="text"
            className="name"
            placeholder="이름을 입력해주세요."
          />
        </span>
        <span className="nameMes"></span>
        <span>
          <input
            type="text"
            className="emailVal"
            placeholder="이메일을 입력해주세요."
          />
        </span>
        <span className="emailMes"></span>
        <span>
          <input
            type="text"
            className="ageVal"
            placeholder="나이를 입력해주세요."
          />
        </span>
        <span className="ageMes"></span>
        <span>
          <input
            type="text"
            className="passVal1"
            placeholder="비밀번호를 입력해주세요."
          />
        </span>
        <span className="passMes1"></span>
        <span>
          <input type="text" className="passVal2" placeholder="비밀번호 확인" />
        </span>
        <span className="passMes2"></span>
      </div>
      <div>
        <button>제출하기</button>
      </div>
      <div className="movePage">
        <span>이미 아이디가 있으신가요?</span>
        <span>로그인 페이지로 이동하기</span>
      </div>
    </SignupContainer>
  );
};

const SignupContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 80px 0;
  gap: 45px;

  .inputDiv {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    gap: 20px;
  }

  .movePage {
    display: flex;
    gap: 30px;
  }

  input {
    width: 600px;
    height: 40px;
  }

  button {
    width: 620px;
    height: 60px;
    font-weight: bold;
    font-size: 15px;
  }

  input,
  button {
    border-radius: 35px;
    padding-left: 15px;
  }
`;
